import React, { Component } from "react";

import "../../styles/SessionWeb.css";

class SessionWeb extends Component {
  state = {};
  render() {
    return (
      <div class="sessionFlex">
        <div class="sessionMiddle"></div>
        <div class="sessionRight"></div>
      </div>
    );
  }
}

export default SessionWeb;
